    list-style-type: none;
`


const Right = styled.div`
    display: flex;
    flex: 1;
    flex-direction: column;
    gap: 10px;
    height: 200px;



    `;

const RightTitle = styled.div`
    font-size: 26px;
    font-weight: 600;
    margin-left: 20px;

`;

const RightDescription = styled.div`
    margin-left: 20px;

`;

const Phone = styled.h3`
    font-size: 22px;
`;

const Email = styled.h3`
    font-size: 22px;
`;

const Footer = () => {
    return (
        <Container>
            <Left>
                <LeftTitle>XONSANDSON</LeftTitle>
